    /**
     * Main method to run the server operations sets base data
     *
     * @param args command line arguments
     */
    public static void main(String[] args) {
        // creates the tables
        CitiesDBHelper.createTable();
        //import list of cities from the govAPI
        CitiesUtil.importCitiesFromGovAPI();
        UserDBHelper.createTable();
        PetsDBHelper.createTable();
        ContactusDBHelper.createTable();
        System.out.println("Tables created");

//         sets the basic data
        addPets(); //adds Pets to Pets table
        addUsers(); //adds Users to Users table
        addContactRequests(); //adds ContactUs requests to Contactus table
        System.out.println("Data samples added");
    }

